import React from 'react';
import './Home.css';
import Fundo from '../../assets/fundo.jpg';
import { FaLaptopCode, FaMobileAlt, FaDesktop } from 'react-icons/fa';

function Home() {
    return (
        <section className="home">
            <img src={Fundo} alt="Fundo" className="fotoFundo" />
            <div className="home-content">
                <h1>Bem-vindo ao meu portfólio</h1>
                <p>
                    <FaLaptopCode className="icon" /> <FaMobileAlt className="icon" /> <FaDesktop className="icon" />
                    Desenvolvedora de Sites & Sistemas, apaixonada por transformar ideias em soluções digitais personalizadas.
                    Auxilio empresas e empreendedores a criarem uma presença online moderna e eficiente.
                </p>

                <p>
                    Vamos inovar juntos? Exploro novas possibilidades para o seu projeto enquanto sigo minha trajetória
                    como desenvolvedora back-end.
                </p>

                <a href="#contato" className="cta-button">Entre em contato</a>
            </div>
        </section>
    );
}

export default Home;
